import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <nav className="navbar">
        <div className="heading">
          <h1>Blog</h1>
          <p>blog by Ayush</p>
        </div>
        <div className="links">
          <div className="links-flex">
            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/create">New Blog</Link>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Navbar;
